        def mr_convert(measurement):
            """Converts mass to radius using whichever M-R relationship is active"""

            R_r = 1.03*measurement**0.29
            R_v = 0.7*measurement**0.63
            
            if measurement > 25 or (measurement > 5 and config_parameters["otegi_rho"] == "volatile"):
                return R_v

            return R_r


