    def get_targets(self, mode, system, radmax, removed=[]):
        """Gets the specific set of targets based on config parameters"""

        targets = self.targets
        sub_targets = {}

        if mode == "single":
            for key in targets.keys():
                if key.find(system) != -1:
                    if len(removed) > 0:
                        sub_targets[key] = tuple(list(targets[key]) + [removed])

                    else:
                        sub_targets[key] = targets[key]

                    break

            return sub_targets

        radmax = int(radmax)
        radmax_keys = []

        for key in targets.keys():
            if np.all(np.array([targets[key][j][1] for j in range(1, len(targets[key]))]) < radmax):
                radmax_keys.append(key)

        for key in radmax_keys:
            if mode == "TESS" and key.find("TOI") != -1 and key.find("test") == -1:
                sub_targets[key] = targets[key]

            elif mode == "Kepler" and (key.find("Kepler") != -1 or key.find("K2") != -1) and key.find("test") == -1:
                sub_targets[key] = targets[key]

            elif mode == "all" and key.find("test") == -1:
                sub_targets[key] = targets[key]

            elif mode == "test" and key.find("test 3") != -1:
                sub_targets[key] = targets[key]

        return sub_targets



    def otegi_mr(self, measurement, predict, density):
        """Uses a power-law MR to predict mass in Earth values from radius in Earth values or vice versa"""

        if predict == "radius":
            R_r = 1.03*measurement**0.29
            R_v = 0.7*measurement**0.63
            
            if measurement > 25 or (measurement > 5 and density == "volatile"):
                return R_v

            return R_r

        elif predict == "mass":
            M_r = 0.9*measurement**3.45
            M_v = 1.74*measurement**1.58

            if M_r > 25 or (M_r > 5 and density == "volatile"):
                return M_v

            return M_r
